const input = ''



const reactPolymer = (input) => {

    const getLeftUnitIndex = index => {
        let i = index - 1
        while (i >= 0 && polymer[i] === '-') {
            i--
        }
        if (i >= 0)
            return i
        return null
    }
    
    const getRightUnitIndex = index => {
        let i = index + 1
        while (i < polymer.length && polymer[i] === '-') {
            i++
        }
        if (i < polymer.length)
            return i
        return null
    }
    
    const triggerReaction = index => {
        const left = getLeftUnitIndex(index)
        const right = getRightUnitIndex(index)
        if (left && checkUnitsReaction(left, index)) {
            polymer[left]='-'
            polymer[index]='-'
            return true
        }
        if (right && checkUnitsReaction(index, right)) {
            polymer[index]='-'
            polymer[right]='-'
            return true
        }
        return null
    }
    
    const checkUnitsReaction = (x, y) => {
        return (
            polymer[x].toLowerCase() === polymer[y].toLowerCase()
            && 
            (
                (polymer[x] === polymer[x].toUpperCase() && polymer[y] === polymer[x].toLowerCase())
                ||
                (polymer[x] === polymer[x].toLowerCase() && polymer[y] === polymer[x].toUpperCase())
            )
        )
    }

    let i = 0
    let reactionHappened
    let polymer = input.split('')
    while (i < polymer.length) {
        reactionHappened = false
        if (polymer[i] !== '-') {
            reactionHappened = triggerReaction(i)
        }
        if (reactionHappened) {
            const left = getLeftUnitIndex(i)
            i = left ? left : 0
        }
        else { i++ }
    }
    return polymer.filter(u => u !== '-')
}

module.exports = {
    input,
    reactPolymer
}

console.log('5-1 solution: ', reactPolymer(input).length)